import React from 'react';
function Contact() {
return (
<div>
<h1>Contact Us</h1>
<form>
<input type="text" placeholder="Your name" />
<input type="email" placeholder="Your email" />
<textarea placeholder="Your message"></textarea>
<button type="submit">Send</button>
</form>
</div>
);
}
export default Contact;
